import React, {Component} from 'react';
import InfiniteCarousel from 'react-leaf-carousel';

export default class extends Component{
  render(){
    return(
      <div style={{paddingTop : '30px'}}>
      <center><h3>Our Sponsors</h3></center>
      <InfiniteCarousel
        breakpoints={[
          {
            breakpoint: 500,
            settings: {
              slidesToShow: 2,
              slidesToScroll: 2,
            },
          },
          {
            breakpoint: 768,
            settings: {
              slidesToShow: 3,
              slidesToScroll: 3,
            },
          },
        ]}
        dots={false}
        showSides={true}
        sidesOpacity={1}
        sideSize={.1}
        slidesToScroll={1}
        slidesToShow={7}
        scrollOnDevice={true}
        lazyLoad={true}
        swipe={true}
        slidesSpacing={10}
        responsive={true}
    >
      {[1,2,3,4,5,6,7,8,9,1,2,3,4,4,5,5,6,7,7].map(x => 
      <div style={{maxHeight: '100px'}}>
        <img
          alt=''
          height="100"
          src='https://banner2.kisspng.com/20171201/91b/batman-logo-png-5a20f3a8da66b7.6067604515121089688946.jpg'
        />
      </div>)}
    </InfiniteCarousel>
    </div>
    )
  }
}
